Start Transaction;

Drop Table If Exists twenty_one_happiness_percentage;

Create Table twenty_one_happiness_percentage(

    id serial,
    country_name varchar(50),
    total_score numeric(7,3),
    residual_percent numeric(7,3),
    gdp_percent numeric(7,3),
    corruption_percent numeric(7,3),
    life_expectancy_percent numeric(7,3),
    social_support_percent numeric(7,3),
    generosity_percent numeric(7,3),
    personal_autonomy_percent numeric(7,3)

);
Commit;
